INSERT INTO `vcos_article_language` VALUES ('1', '81', 'zh_cn', '中华泰山封禅大典25日与泰安观众再见', '<p>　中华泰山网11月11日讯(记者 张越嘉)中华泰山网记者从泰山封禅大典获悉，《中华泰山·封禅大典》大型实景演出2015年演出季将于9月25日结束，25日为今年最后一场封禅祈福盛宴，演出将于明年3月恢复。<br/></p>', '中华泰山封禅大典');
INSERT INTO `vcos_article_language` VALUES ('2', '83', 'zh_cn', '船长刘仁才给您的重要信息！！！', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp; 我们将继续朝着水流湍急的中国海域的东部航行。在能见度较好的情况下。我们会隐约看到济州岛的南部。前往烟台的航行期间，特别是在某些特定的区域，我们会遇到许多密集的渔船。</span></p>', '重要信息');
INSERT INTO `vcos_article_language` VALUES ('25', '83', 'en', 'f', '<p>s</p>', 'd');
INSERT INTO `vcos_article_language` VALUES ('27', '85', 'zh_cn', '领略阿拉伯海湾中东风情', '<p><span style=\"font-family:Arial;font-size:16px\">&nbsp; 神秘的中东风情，奢华的阿拉伯体验，成为邮轮旅游的新宠。近日，2014年迪拜商业及旅游业推广局“阿拉伯海湾邮轮中国区路演”在广州W酒店举行。迪拜作为中东地区首屈一指的邮轮目的地，到中国来推广邮轮产品尚属首次。</span></p>', '迪拜成邮轮新宠');
INSERT INTO `vcos_article_language` VALUES ('29', '87', 'zh_cn', '海上盛会', '<p>根据邮轮的净重、长度和载客量，为大家盘点世界级超大型邮轮前十名，造型绚丽极致奢华。<br/>海洋魅力号邮轮于2010年制造，比同公司海洋绿洲号长2英寸(约5厘米)，成为目前世界上最大的邮轮。这艘邮轮为图库尔船厂建造的一系列世界上最大的邮轮中的第二艘邮轮。第一艘是海洋绿洲号，两艘邮轮堪称姐妹船。<br/>海洋绿洲号邮轮于2009年11月下海进行处女航，当它在海上航行时，它就像是一座“旅行的城市”，有37个酒吧和20个餐厅。海洋绿洲号邮轮上拥有一片开阔的露天广场，两边则为带有阳台的客房。海洋绿洲号耗资14亿美元，比泰坦尼克号还要大3倍多。</p>', '最豪华的邮轮的聚首');
INSERT INTO `vcos_article_language` VALUES ('31', '89', 'zh_cn', '中加最长10年签证实行免面谈免留指纹', '<p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">会上，新京报记者得到提问机会，就读者关心的签证政策和海外出行便利、权益保护的措施向外交部部长王毅提问。新京报记者 陈杰 摄</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">昨日，外交部长王毅表示，中国和加拿大就互发有效期最长为10年的签证达成一致，9日起实施。这是继去年11月中美达成长期多次签证互惠安排之后，又一发达国家就签证便利化与中国达成长期机制性安排。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">9日起中加互发最长10年签证</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">据悉，中国和加拿大双方同意，自2015年3月9日起互为前往对方国家从事商务、旅游、探亲活动的对方公民颁发长期多次签证。只要护照有效期足够，签证有效期最长可达10年。这一互惠安排与两国良好的战略伙伴关系密不可分。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">近\r\n年来，双方高层和各级别交往频繁，经贸合作规模不断扩大。2013年，中加人员往来近120万人次，中国在加留学生近10万。加拿大是中国境外投资第二大\r\n目的地国，中国是加第二大贸易伙伴、第二大进口来源地和第二大出口市场，是加最大留学生来源国和海外游客增长最快国，中文已成为加第三大语言。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">在此背景下，中加两国政府顺应民意，达成签证互惠安排，将进一步拓宽两国各领域交往渠道，给两国人民带来实实在在的便利和好处。</p><p style=\"margin: 0px 0px 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 24px; orphans: auto; text-align: left; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">据了解，根据对等互惠原则，中加双方还将各自相关签证的单、多次签证收费统一调整为100加元和相应的人民币。双方对签证申请人均提供免面谈和免留指纹的便利。拿到多次签证后，就意味着可以随时拿起护照，来一场说走就走的旅行。</p><p><br/></p>', '旅游福利');
INSERT INTO `vcos_article_language` VALUES ('33', '91', 'zh_cn', '海上音乐节', '<p>伴随着窗外海水拍打声醒来，崭新的一天开始，站在甲板上呼吸着海上的空气，血液和心肺得到一种透析，此刻，心中只有那片深蓝，像人鱼公主被海上美丽的歌声吸引，体验一场海上美丽的音乐盛宴！<br/></p>', '海上的音乐盛宴');
INSERT INTO `vcos_article_language` VALUES ('39', '95', 'zh_cn', '三大邮轮集团全球CEO首次齐聚CCS10', '<p style=\"text-indent:22.0pt;\"><span style=\"font-size:11.0pt;line-height:150%;font-family:\" span=\"\">13-15</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">日，国家旅游局和中国交通运输协会共同主办、中国交通运输协会邮轮游艇分会（</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\" span=\"\">CCS10</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">）将在上海虹口举办。本届大会主题是“邮轮·海上生活新时尚”。</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\" p=\"\" span=\"\">8</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">月国务院出台的《关于进一步促进旅游投资和消费的若干意见》，在CCS10</span><span style=\"font-size:11.0pt;line-height:150%;font-family:宋体;\">同期特别主办首次全国邮轮旅游推进会，必将在国内外旅游界产生重大影响。</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\" span=\"\"></span> </p><p style=\"text-indent:22.0pt;\"><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\"></span></p><p style=\"text-indent:22.0pt;\"><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCYIA</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">常务副会长兼秘书长、大会组委会秘书长郑炜航透露：目前，包括皇家加勒比游轮集团、嘉年华邮轮集团、挪威邮轮集团在内的全球三大邮轮公司</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CEO</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">已经确认率团来华出席本届盛会，这是</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCS</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">举办</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">年来首次，可见国际邮轮巨头对中国市场的重视。</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">月</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">13</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">日晚开幕式上，有的将携新高管在</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCS10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">全球首次亮相，有的将在</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\">CCS10</span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\">全球首次宣布新战略，共同推动邮轮旅游度假这一时尚海上出游休闲方式。</span> </p><p style=\"text-indent:22.0pt;\"><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:&#39;&#39;;\"></span><span style=\"text-indent:22pt;font-size:11pt;line-height:150%;font-family:宋体;\"></span></p><p><br/></p><p><br/></p>', '邮轮产业大会在上海举行');
