INSERT INTO `vcos_cruise_info_language` VALUES ('35', '31', 'zh_cn', '<p>“中华泰山”邮轮隶属于中国首家国际邮轮公司——渤海邮轮有限公司，该公司成立于2014年2月，是渤海轮渡股份有限公司全资子公司，总部设在香港。邮轮公司注册地在香港，邮轮悬挂巴拿马旗。中华泰山号邮轮是我国第一艘全资、自主经营管理的豪华邮轮,该邮轮于今年3月底从意大利启航,5月初到达国内,后更名为“中华泰山”号。</p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('37', '33', 'zh_cn', '<p>船内各种配套设施非常完善，剧院、画廊、图书馆、网吧、钢琴吧、迪斯科舞厅娱乐场、游泳池、水疗按摩+桑拿、宴会厅、各式餐厅、酒吧俱乐部、多功能会议室 、棋牌室、儿童护幼中心、免税店、健身房、娱乐会所、小教堂等一应俱全，可以满足船上乘客各项生活和娱乐需求。</p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('39', '35', 'zh_cn', '<p>满载排水量：2.45万吨&nbsp;&nbsp; 平均航速：22节<br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 甲板楼层：7层&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 客房数量: 416间<br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 船长：180.45米&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 船宽：25.5米<br/><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 最高航行速度: 28节&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; 载客量：927人</p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('45', '41', 'zh_cn', '<p>船内各种配套设施非常完善，剧院、画廊、图书馆、网吧、钢琴吧、迪斯科舞厅、娱乐场、游泳池、水疗按摩+桑拿、宴会厅、各式餐厅、酒吧俱乐部、多功能会议室、棋牌室、儿童护幼中心、免税店、健身房、娱乐会所、小教堂等一应俱全，可以满足船上乘客各项生活和娱乐需求.</p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('47', '41', 'en', '<p>哈哈</p><p><br/></p><p></p><p><br/></p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('49', '43', 'zh_cn', '<p>歌诗达邮轮（Costa Cruise Lines）曾经是世界上最大的邮轮，起源于1860年的Costa家族，名字源自始创人贾西莫。歌诗达先生（Giacomo Costa），有着悠久而辉煌的历史。以“意大利风情（Cruising Italian Style）为品牌定位的意大利歌诗达邮轮公司是欧洲地区最大的邮轮公司。<br/>歌诗达的豪华邮轮无论是外观还是内部装潢，都弥漫着一股意大利式的浪漫气息，尤其在蔚蓝的欧洲海域，歌诗达船队以艳黄明亮色调的烟囱，搭配象征企业识别标志的英文字母C，航行所到之处均是掀起人们惊艳的目光，成为欧洲海域最为璀璨耀眼的船队！之所以选择歌诗达品牌率先进入中国市场，是因为该品牌为嘉年华旗下12个邮轮品牌中最国际化的一个。在进入中国之前，歌诗达邮轮的足迹遍布除亚洲以外的几乎任何一个地区，而如今来到中国，可以称得上是填补了全球版图上的最后一块空白.<br/></p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('50', '44', 'zh_cn', '<p>皇家加勒比邮轮体验全舱“海景”时代，坐拥智能科技舱房，精心的设计与装潢。科技与创意的结合，惊险与乐趣的共融，领略“舌尖上的量子号　</p>');
INSERT INTO `vcos_cruise_info_language` VALUES ('52', '44', 'en', '<p>english皇家加勒比邮轮体验全舱“海景”时代，坐拥智能科技舱房，精心的设计与装潢。科技与创意的结合，惊险与乐趣的共融，领略“舌尖上的量子号　</p>');
