INSERT INTO `vcos_lifeservice_language` VALUES ('73', '111', 'zh_cn', '激情娱乐城酒吧ktv', '仅售88元！最高价值258元的激情娱乐城酒吧特惠套餐引爆全场，建议3-5人使用，提供免费WiFi。', '<p>操作便捷，超过四万首的超大歌库，另有每月新增百余首最新的单曲,在此您将紧跟流行的前沿。贴心的服务品质，平价齐全的购物超市，现代时尚的装修环境，经济实惠的价格，激情娱乐城酒吧ktv与您一起尽情唱享音乐的快乐。</p>', '井岸镇', '20:00-次日02:00');
INSERT INTO `vcos_lifeservice_language` VALUES ('75', '113', 'zh_cn', '魅力四射', '仅售128元！价值446元的激情畅饮，建议4人使用，2张美团券可升级，提供免费WiFi。', '<p>由北京著名第三空间乐队驻场演出，每晚9点呈现激情演艺！场地面积600平，能容纳200多人共同畅饮！是本市唯一一家大型现场酒吧！内设台球、俄罗斯转盘以及各种棋牌娱乐设施<br/></p>', '第六甲板层', '20:30-次日02:00');
INSERT INTO `vcos_lifeservice_language` VALUES ('77', '115', 'zh_cn', '喜悦SPA保健会所', '仅售50元！价值60元的海利足疗1次，男女不限，提供免费WiFi。', '<p>当身体浸泡在温泉水中，由于液体静力压的关系，令血液在体内重新分布，据某统计分析约有700ml血液回流至胸腔内，而造成利尿效果，故风湿性关节炎等肿胀关节因而可以消退，并且在水中浮力及温热效应也可减少肌肉张力、减少疼痛及改善关节活动度。</p>', '第三甲板层', '10:00-23:00');
