INSERT INTO `vcos_line_detail_language` VALUES ('2', '3', 'zh_cn', '第三天', '<p>今天迎来全天的邮轮海上巡游，让轻松舒适来开启您的邮轮之旅。您可以根据自己的喜好，享受船上的休闲娱乐设施及各式美食,体验丰富多彩的娱乐项目,参加特色的船上课程。</p>', null);
