INSERT INTO `vcos_line_detail_language` VALUES ('27', '17', 'zh_cn', '第三天', '<p>巴特罗之家如果不是亲眼所以见，真的不敢相信这个世界上还有这样的建筑，令人惊艳。我只能告诉大家建筑本身就是件精湛...</p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('29', '19', 'zh_cn', '第二天', '<p>圣家族大教堂非常另类的大教堂，外形酷似魔窟，但走进去才会发现这里仍然保留了传统教堂的功能，但装饰更为前卫、另类，.<br/></p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('31', '21', 'zh_cn', '第一天', '<p>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！</p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('33', '23', 'zh_cn', '第四天', '<p>迎着微微海风的吹拂，您将抵达终点港口。您可以凭海临风，看着邮轮缓缓驶入码头——结束这一难忘的假期。</p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('35', '25', 'zh_cn', '第三天', '<p>珍南海滩的白天和夜晚都深深吸引我们，白天的湛蓝清澈，夜晚的安静幽美让人流连忘返，下次去兰卡威还是首选...</p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('37', '27', 'zh_cn', '第二天', '<p>兰卡威（Langkawi）可以算得上是东南亚最令人向往的风景胜地。清澈碧绿的海水和绵长平缓的沙滩构成了天堂般的海滨度假地，葱郁繁茂的森林与神秘而壮观的岩洞是独具魅力的探险地。&nbsp;&nbsp; <br/></p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('39', '29', 'zh_cn', '第一天', '<p>请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅！</p>', null);
INSERT INTO `vcos_line_detail_language` VALUES ('43', '33', 'zh_cn', '第四天', '<p>今天迎来全天的邮轮海上巡游，让轻松舒适来开启您的邮轮之旅。您可以根据自己的喜好，享受船上的休闲娱乐设施及各式美食,体验丰富多彩的娱乐项目,参加特色的船上课程。</p>', 'line_images/201510/201510121039415038.jpg');
INSERT INTO `vcos_line_detail_language` VALUES ('45', '35', 'zh_cn', '第三天', '<p>【原子弹爆炸纪念馆】馆内展示当时原爆的原始图片和文字资料，以及当今世界各国的核武器试验状况，提醒我们要时刻维护世界和平。</p>', 'line_images/201510/201510121038594543.jpg');
INSERT INTO `vcos_line_detail_language` VALUES ('47', '37', 'zh_cn', '第二天', '<p>【长崎中华街】新地中华街与横滨、神户的中国式街道并列为日本三大中华街。</p>', 'line_images/201510/201510121038286375.jpg');
INSERT INTO `vcos_line_detail_language` VALUES ('49', '39', 'zh_cn', '第一天', '<p>&nbsp;&nbsp;&nbsp;&nbsp; 登船 请您前往港口，办理邮轮登船手续，登上邮轮，开始您浪漫精彩的邮轮之旅。</p>', 'line_images/201510/201510121037346136.jpg');
