INSERT INTO `vcos_line_detail_language` VALUES ('53', '43', 'zh_cn', '第三天', '<p>【南怡岛】（约2小时）因韩剧《冬季恋歌》而蜚声全亚洲，剧中男女主人公俊相和有真就曾幸福地在小岛的四处徜徉。 <br/></p>', 'line_images/201510/201510121044121733.jpg');
INSERT INTO `vcos_line_detail_language` VALUES ('55', '45', 'zh_cn', '第二天', '<p>【N首尔塔外观+爱情锁墙】首尔塔（不含登塔费用）及爱情锁墙为【来自星星的你】千颂伊与教授锁住爱情的地方。</p>', 'line_images/201510/201510121043514794.jpg');
