INSERT INTO `vcos_line_detail_language` VALUES ('61', '51', 'zh_cn', '第三天', '<p>【博多运河城】博多运河城是福冈乃至九州最热闹的一个购物娱乐中心。自由活动。</p>', 'line_images/201510/201510111849316129.jpg');
INSERT INTO `vcos_line_detail_language` VALUES ('63', '53', 'zh_cn', '第二天', '<p>【龙头岩】汉拿山喷出的熔岩堆积而成的奇岩绝景，龙升天形状的奇石，济州观光的象征。</p>', 'line_images/201510/201510111849211906.jpg');
