INSERT INTO `vcos_meetingroom_language` VALUES ('19', '21', 'zh_cn', '<p>大家可在这里讨论问题，探讨学术问题，演示ppt，远程视屏都可以做的事情。</p>');
INSERT INTO `vcos_meetingroom_language` VALUES ('21', '23', 'zh_cn', '<p>中型会厅可容纳10-50人．并可提供相关的会议服务设备，以及茶歇，饮用水等服务。</p>');
