INSERT INTO `vcos_meetingroom_language` VALUES ('25', '27', 'zh_cn', '<p>免费提供设施指示牌、话筒、白板、笔纸、主席台、茶水、演讲台、植物。在我们的会议楼内还陈设有数百件艺术品。</p>');
INSERT INTO `vcos_meetingroom_language` VALUES ('27', '29', 'zh_cn', '<p>不同风格、不同方式的会议室更可为您的会议需求及休闲度假提供一个理想而满意的场所。</p>');
INSERT INTO `vcos_meetingroom_language` VALUES ('29', '29', 'en', '<p></p><p>no</p><p><br/></p>');
INSERT INTO `vcos_meetingroom_language` VALUES ('33', '37', 'zh_cn', '<p>大型会议会创意而时尚的优雅会所及餐饮场所，是私人聚会、婚宴、产品推介、鸡尾酒会及公司会议的理想选择。</p>');
INSERT INTO `vcos_meetingroom_language` VALUES ('35', '37', 'en', '<p>Valeri was a new student . She walked to class with her books huddled \r\nagainst her chest and her head down . He talked only when the teacher \r\nasked her a question . After a month at our school , she hadn&#39;t made any\r\n friend . At recess , she sat on a bench and read . If you asked who she\r\n was , you&#39;d get a response like this , &quot;She&#39;s in my PE class , I can&#39;t \r\nremenber her name .&quot;</p>');
