INSERT INTO `vcos_port_detail_language` VALUES ('75', '71', 'zh_cn', '<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/127388.htm\">郴州市</a>位于<a target=\"_blank\" href=\"http://baike.baidu.com/view/8581.htm\">湖南</a>省东南部，地处<a target=\"_blank\" href=\"http://baike.baidu.com/view/122278.htm\">南岭</a>山脉与<a target=\"_blank\" href=\"http://baike.baidu.com/view/901396.htm\">罗霄山</a>脉交错、<a target=\"_blank\" href=\"http://baike.baidu.com/subview/4185/4998436.htm\">长江</a>水系与珠江水系分流的地带。“北瞻衡岳之秀，南峙五岭之冲”，自古以来为中原通往华南沿海的“咽喉”。既是“兵家必争之地”，又是“人文毓秀之所”。东界江西赣州，南邻广东韶关，西接湖南永州，北连湖南衡阳、株洲，素称湖南的“南大门”。</p><p><br/></p>');
INSERT INTO `vcos_port_detail_language` VALUES ('80', '76', 'zh_cn', '<p>qq<br/></p>');
INSERT INTO `vcos_port_language` VALUES ('1', '13', 'zh_cn', '仁川', 'cruiseinfo_images/201510/201510120942077843.jpg', '市内的建筑古老和现代共存，既有景福宫等朝鲜时代的古宫，也有最尖端的综合文化设施。');
INSERT INTO `vcos_port_language` VALUES ('2', '43', 'zh_cn', '福冈', 'cruiseinfo_images/201510/201510120944115630.jpg', '福冈县位于九州北端，东北部濒临周防滩，西北部面对玄海滩，西南部面对有明海。这里与朝鲜半岛和中国大陆隔海相望，是日本最早接触大陆文化的地方');
INSERT INTO `vcos_port_language` VALUES ('3', '59', 'zh_cn', '首尔', 'cruiseinfo_images/201510/201510120955357046.jpg', '四季的首尔都呈现出迷人的景色，吸引着海内外的游客到韩国旅游观光。首尔是一座现代与古老兼并的大都市。');
INSERT INTO `vcos_port_language` VALUES ('4', '61', 'zh_cn', '济州', 'cruiseinfo_images/201510/201510120958111442.jpg', '温和湿润的气候和由火山活动塑造出的绮丽多彩的自然风景，使它赢得了“韩国的夏威夷”的美誉。');
INSERT INTO `vcos_port_language` VALUES ('5', '74', 'zh_cn', '上海', 'cruiseinfo_images/201510/201510121001321444.jpg', '花花绿绿的上海，行色匆匆的上海，穿睡衣的上海，泡夜店的上海。 ');
INSERT INTO `vcos_port_language` VALUES ('6', '74', 'en', 'shanghai', null, null);
INSERT INTO `vcos_port_language` VALUES ('13', '79', 'zh_cn', '基隆', 'cruiseinfo_images/201510/201510121003363682.jpg', '昔日的古老文明和浑然天成的自然景观交相辉映出这样一座美丽的基隆，巧夺天工的岛屿、昔日威风赫赫的古炮台，为你的旅行留下一道道靓丽的风景线。');
INSERT INTO `vcos_port_language` VALUES ('15', '79', 'en', 'baodao', null, null);
INSERT INTO `vcos_port_language` VALUES ('19', '85', 'zh_cn', '香港', 'cruiseinfo_images/201510/201510121005434143.jpg', '香港风和日丽，穿着衬衣、毛衣及轻便外衣漫步在香港宽广美丽的维多利亚港，既有凉风习习，又不失温暖惬意');
INSERT INTO `vcos_port_language` VALUES ('21', '85', 'en', 'xinaggang', 'cruiseinfo_images/201509/201509191257051443.jpg', null);
INSERT INTO `vcos_port_language` VALUES ('23', '87', 'zh_cn', '釜山', 'cruiseinfo_images/201510/201510121007204891.jpg', '韩国第二大城市，釜山所处的地理位置优越。除是一个天然良港以外，在其海岸线上还有很好的沙滩和美丽的海滨风景；城市的周围被连绵的群山所环抱，城市中的温泉星罗棋布。');
INSERT INTO `vcos_port_language` VALUES ('27', '87', 'en', '1', 'room_images/201509/201509251444522951.jpg', null);
INSERT INTO `vcos_port_language` VALUES ('37', '95', 'zh_cn', '长崎', 'cruiseinfo_images/201510/201510130910049986.jpg', '长崎，是日本九州岛西岸著名港市，长崎县首府。长崎市位于日本的西端，与我国上海相隔仅800公里，自古以来就是沟通中国与日本的桥梁。景色非常的美丽。长崎，是日本九州');
