INSERT INTO `vcos_strategy_language` VALUES ('1', '1', '大连美食店铺', '在大连的各大美食街、路边烧烤摊都能看到烤鱿鱼的身影，受欢迎程度可见一斑。', '1', 'strategy_images/201510/201510111448572359.jpg', null, null, '200', '甲板七层', '烧烤', '13750087547', '在大连的各大美食街、路边烧烤摊都能看到烤鱿鱼的身影，受欢迎程度可见一斑。', '<p>大连的铁板烤鱿鱼十分有名，当地产的鱿鱼肉质鲜嫩，烤到恰到好处时刷上蒜蓉辣酱，吃过担保会上瘾。在大连的各大美食街、路边烧烤摊都能看到烤鱿鱼的身影，受欢迎程度可见一斑。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('2', '2', '乌鱼子', '将乌鱼卵用盐腌制，去掉盐汁，就制成了乌鱼子。由于形状像中国的墨，所以也称唐墨。把乌鱼子微微熏烤后，切成薄片就可以下酒了。', '1', 'strategy_images/201510/201510111455233154.jpg', null, null, '1000', '甲板二层', '下酒点心', '18723131397', '将乌鱼卵用盐腌制，去掉盐汁，就制成了乌鱼子。由于形状像中国的墨，所以也称唐墨。把乌鱼子微微熏烤后，切成薄片就可以下酒了。', '<p>美食</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('3', '5', '大连商场', '礼服购买', '1', 'strategy_images/201510/201510111619287722.jpg', null, null, '120', '甲板三层', '购物', '13750087547', '样式多', '<p>样式多<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('9', '13', '蓬莱阁', '蓬莱阁的天后宫是我国北方最大的天后宫庙宇之一。正中端坐的是天后，再塑金身。天后是海峡两岸人民虔诚信奉的海神', '1', 'strategy_images/201510/201510091338009299.jpg', null, null, '5000', '烟台', '风景', '13750087547', '独特', '<p>哈哈哈哈a</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('13', '15', '极乐寺', '极乐寺位于亚依淡（AirHitam），面积12万平方米，乃是东南亚最大的佛寺，寺内五彩缤纷的建筑鳞次栉比，无论是当地华人还是游客都乐于前往', '1', 'strategy_images/201510/201510111604594467.jpg', null, null, '3000', '马来西亚', '免费', '13750087547', '历史', '<p>历史</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('17', '17', '七浦路服装批发市场 ', '用心就能搭配成超级大牌的模样。可能花个百元，你就成了个超级有范儿的弄潮儿，鞋子裤子衣服帽子一样不拉，超级有成就感', '1', 'strategy_images/201510/201510091605194173.jpg', null, null, '200', '上海', '生活', '1723131397', '应有尽有', '<p>满足您一切所需</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('23', '23', '标准大房', '标准宽度，大床', '1', 'strategy_images/201509/201509291516472094.jpg', null, null, '200', '甲板四层', '住宿', '13750087547', '舒适', '<p>标准大房，舒适温馨<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('25', '25', '贵宾房', '豪华贵宾房', '1', 'strategy_images/201509/201509291516329499.jpg', null, null, '550', '甲板五层', '住房', '13825173818', '豪华', '<p>贵宾房内设水上泡澡，超软大床<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('27', '27', '蓬莱小面', '蓬莱小面是蓬莱传统名吃，历史悠久。每碗的面坯为50g，卤多面少，盛面的器皿又小巧玲珑，故称“蓬莱小面”。', '1', 'strategy_images/201510/201510091020175306.jpg', null, null, '500', '甲板三层中部', '鲁菜', '18723131397', '蓬莱小面是蓬莱传统名吃，历史悠久。每碗的面坯为50g，卤多面少，盛面的器皿又小巧玲珑，故称“蓬莱小面”。面条为人工拉制', '<p>美味好吃热闹蓬莱小面是蓬莱传统名吃，历史悠久。每碗的面坯为50g，卤多面少，盛面的器皿又小巧玲珑，故称“蓬莱小面”。面条为人工拉制</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('29', '29', '上海生煎包', '上海生煎包可以说是土生土长的上海点心，据说已有上百年的历史。其特点为：皮酥、汁浓、肉香。轻咬一口，肉香、油香、葱香、芝麻香全部的美味在口中久久不肯散去', '1', 'strategy_images/201510/201510091028445466.jpg', null, null, '5000', '7层甲板', '小吃', '18562354798', '上海生煎包可以说是土生土长的上海点心，据说已有上百年的历史。其特点为：皮酥、汁浓、肉香。轻咬一口，肉香、油香、葱香、芝麻香全部的美味在口中久久不肯散去', '<p>美味<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('31', '31', '寿司', '寿司一般可以分成手捏寿司和卷寿司。手捏寿司就是在醋味小饭团上面加上切成小片的各类新鲜海鲜，例如金枪鱼、虾、墨鱼等等', '1', 'strategy_images/201510/201510111507245836.jpg', null, null, '2000', '7层甲板', '点心', '18562354798', '寿司一般可以分成手捏寿司和卷寿司。手捏寿司就是在醋味小饭团上面加上切成小片的各类新鲜海鲜，例如金枪鱼、虾、墨鱼等等', '<p>sk<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('33', '33', '鳗鱼', '日本常见的鳗鱼分为两种，一种是淡水鳗鱼，称为鰻，一般以日本本地出产的野生鳗鱼为最佳，另一种是海水中生长的星鳗，称为穴子', '1', 'strategy_images/201510/201510121400149252.jpg', null, null, '3000', '甲板三层', '小吃', '15858585858', '日本常见的鳗鱼分为两种，一种是淡水鳗鱼，称为鰻，一般以日本本地出产的野生鳗鱼为最佳，另一种是海水中生长的星鳗，称为穴子', '<p>美味可口</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('35', '35', '味噌猪排', '味噌猪排是将名古屋特有红味噌淋在刚炸起的猪排上食用，至于酱汁的味道和浓淡则各店不一，不过倒入大量酱汁淋遍整块猪排，则是名古屋特有的吃法。', '1', 'strategy_images/201510/201510121401464531.jpg', null, null, '5000', '甲板三层', '点心', '15858585858', '味噌猪排是将名古屋特有红味噌淋在刚炸起的猪排上食用，至于酱汁的味道和浓淡则各店不一，不过倒入大量酱汁淋遍整块猪排，则是名古屋特有的吃法。', '<p>可口<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('37', '37', '槟榔律驰名潮州煎蕊', '槟榔律驰名潮州煎蕊有点像我们吃的刨冰，不过味道就大不一样啦，是又咸又甜的味道', '1', 'strategy_images/201510/201510111516005864.jpg', null, null, '10000', '7层甲板', '汤', '15255252525', '槟榔律驰名潮州煎蕊有点像我们吃的刨冰，不过味道就大不一样啦，是又咸又甜的味道', '<p>又咸又甜</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('39', '39', '杨氏肉骨茶', '巴生肉骨茶是全马最有名的，当地人说，也是自己的体验，随便走进一家都好吃！这边会先用茶洗餐具，然后再边喝云南普洱边吃肉骨茶。', '1', 'strategy_images/201510/201510091112259920.jpg', null, null, '2000', '7层甲板', '茶', '15858585858', '巴生肉骨茶是全马最有名的，当地人说，也是自己的体，随便走进一家都好吃！这边会先用茶洗餐具，然后再边喝云南普洱边吃肉骨茶。肉骨茶可以算作马来西亚最好的食物，没', '<p>巴生肉骨茶是全马最有名的，当地人说，也是自己的体验——随便走进一家都好吃！这边会先用茶洗餐具，然后再边喝云南普洱边吃肉骨茶。肉骨茶可以算作马来西亚最好的食物，没有之一！<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('41', '41', '鲍鱼粥', '鲍鱼自古就是献给国王的贡品，营养价值高，对恢复肝功能有特效。济州海域风浪大，不适合养殖鲍鱼，因此这里出产的鲍鱼都是自然生长的', '1', 'strategy_images/201510/201510111535078713.jpg', null, null, '1000', '7层甲板', '粥', '13636363636', '鲍鱼自古就是献给国王的贡品，营养价值高，对恢复肝功能有特效。济州海域风浪大，不适合养殖鲍鱼，因此这里出产的鲍鱼都是自然生长的', '<p>美味可口</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('43', '43', '酱炸鸡', '酱炸鸡是在韩国非常流行的一种小吃，韩国许多明星都代言过酱炸鸡块，其中仁川的新浦市场酱炸鸡尤其的出名。一进入市场内，炸鸡的味道就扑面而来。', '1', 'strategy_images/201510/201510091128007095.jpg', null, null, '2000', '7层甲板', '小吃', '18562354798', '酱炸鸡是在韩国非常流行的一种小吃，韩国许多明星都代言过酱炸鸡块，其中仁川的新浦市场酱炸鸡尤其的出名。一进入市场内，炸鸡的味道就扑面而来。', '<p>美味可口<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('45', '45', ' 松亭3代汤饭 ', '特地去了最有名的松亭3代汤饭店，那里的老板会很热心的教你如何吃一碗猪肉汤饭，但本人并不爱这种面条与米饭的混合料理，味道不算浓烈，也不算清淡', '1', 'strategy_images/201510/201510091132291720.jpg', null, null, '2000', '7层甲板', '汤', '13636363636', '特地去了最有名的松亭3代汤饭店，那里的老板会很热心的教你如何吃一碗猪肉汤饭，但本人并不爱这种面条与米饭的混合料理，味道不算浓烈，也不算清淡', '<p>美味可口</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('47', '51', '金石滩国家旅游度假区', '金石滩国家旅游度假区位于大连市金州区的东部，距大连市区58公里，有“奇石的园林”之美称', '1', 'strategy_images/201510/201510111542425168.jpg', null, null, '10000', '大连市金州区的东部', '山水', '15858585858', '环境优美', '<p>环境优美</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('49', '53', '外滩', '有人说“外滩的故事就是上海的故事”， 外滩的精华就在于52幢风格各异被称为“万国建筑博览”的外滩建筑群', '1', 'strategy_images/201510/201510111239516809.jpg', null, null, '500', '上海', '风景', '15252525252', '优美', '<p>优美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('51', '55', '太宰府', '太宰府，现在泛指以太宰府天满宫为中心的一带景区，而在日本战国时期，这是治理九州地方的部门，此机构担当九州的防务及外交等一切政务', '1', 'strategy_images/201510/201510111558082032.jpg', null, null, '100', '日本福冈', '风景', '15656565656', '环境好', '<p>环境好<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('53', '57', '豪斯登堡', '豪斯登堡位于长崎县佐世保市大村湾，占地152公顷，面积比东京迪斯尼乐园还要大两倍，是亚洲最大的休闲度假主题公园', '1', 'strategy_images/201510/201510091513184581.jpg', null, null, '200', '日本长崎', '风景', '152565656565', '环境优美', '<p>环境优美</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('55', '59', '日本东京塔', '瞭望台内大玻璃镶装，置身其中，仿佛凌空出世远离人间令人赞叹；入夜塔身骤然齐明，夜空中构成一幅绚丽图案，愈发显得神奇雄伟', '1', 'strategy_images/201510/201510091517464912.jpg', null, null, '3300', '日本东京', '风景', '13838383838', '环境优美', '<p>环境优美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('57', '61', '名古屋城', '非常漂亮的建筑，有着浓郁的日本风情。公共服务也非常好，有很多自动售货机，可以选择喜爱的饮品。', '1', 'strategy_images/201510/201510091521076719.jpg', null, null, '2000', '日本名古屋', '风景', '15656565566', '环境优美', '<p>环境优美</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('59', '63', '巴生港', '巴生港　旧名“瑞天咸港”。马来西亚最大港口，1973年建为红海与马六甲海峡之间第一个集装箱货运港', '1', 'strategy_images/201510/201510091532234057.jpg', null, null, '2000', '马来西亚', '风景', '15454545454', '环境优美', '<p>环境优美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('61', '65', '济州岛', '济州岛(chejudoisland)是久负盛名的韩国第一大岛，北距韩南部海岸90多公里，东与日本的九州岛岛隔海相望，地扼朝鲜海峡门户，地理位置十分重要', '1', 'strategy_images/201510/201510111613412241.jpg', null, null, '3000', '韩国', '风景', '18585858585', '环境优美', '<p>环境优美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('63', '67', '仁川大桥', '仁川大桥是座位于韩国仁川广域市的斜拉桥，用于连接松岛国际商务区和仁川国际机场', '1', 'strategy_images/201510/201510091552295872.jpg', null, null, '1000', '仁川', '风景', '15252525252', '环境优美', '<p>环境优美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('65', '69', '釜山', '在釜山观光大致分为海岸观光和内陆观光两部分。海岸观光主要指海水浴场、岛屿、海岸公园等，内陆观光则指釜山市内、历史遗址、金井山城、等', '1', 'strategy_images/201510/201510091554554432.jpg', null, null, '1000', '釜山', '风景', '18787878787', '环境优美', '<p>环境优美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('67', '71', '南大街里', '南大街里是烟台市最繁华的商业区，一般是到烟台购物的第一站。此外，还有不少独具特色的购物街都品类齐全，集购物、餐饮、娱乐一体。', '1', 'strategy_images/201510/201510091559402852.jpg', null, null, '10000', '烟台', '购物', '15656565566', '物美价廉', '<p>物美价廉</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('69', '73', '天神地下街', '地下街适合1、20岁的年轻小姑娘，因为里边所卖商品均是十分时尚的衣服和配饰，而且价格还不贵，适合刚刚工作，钱包不丰的年轻孩子了', '1', 'strategy_images/201510/201510111625456042.jpg', null, null, '10000', '日本福冈', '购物', '15858585858', '物美价廉', '<p>物美价廉<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('71', '75', ' 浜町商业街 ', '很繁华的商业街，好多小店铺，女人到了走不动道', '1', 'strategy_images/201510/201510091614573359.jpg', null, null, '10000', '日本长崎', '购物', '15858585858', '物美价廉', '<p>物美价廉</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('73', '77', '银座', '银座是东京繁华地段的最佳代表，也是东京最有价值的黄金地段，据悉，银座地区每平方米可卖到1500万日元以上，也是全世界最贵的地价', '1', 'strategy_images/201510/201510091623132995.jpg', null, null, '1000000', '日本东京', '购物', '13636363636', '物美价廉', '<p>物美价廉<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('75', '79', '大须商业街', '大须商业街，规模很大，很值得好好逛一逛的', '1', 'strategy_images/201510/201510091639071892.jpg', null, null, '100000', '日本名古屋', '购物', '15852525252', '价廉物美', '<p>价廉物美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('77', '81', 'Gurney广场', '很旺的商场，对面就是海，是旅客购物的最佳地点。这里国际品牌店很多如h&m,uniqlo,等等。各国的饮食店都能找到。', '1', 'strategy_images/201510/201510111631375391.jpg', null, null, '10000', '马来西亚', '购物', '15852525252', '价廉物美', '<p>价廉物美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('79', '83', '步行街', '价廉物美', '1', 'strategy_images/201510/201510091659351803.jpg', null, null, '100000', '马来西亚', '购物', '15852525252', '价廉物美', '<p>价廉物美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('81', '85', '济州机场免税店', '济州机场免税店是韩国国内唯一本国人也可以购物的免税店，只要是到济州观光的游客，任何人都可以到此购物', '1', 'strategy_images/201510/201510111637583429.jpg', null, null, '10000', '韩国', '购物', '15852525252', '价廉物美', '<p>价廉物美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('83', '87', '仁川机场免税店', '仁川机场购物攻略带你玩转机场。仁川机场面积很大，拥有众多免税店', '1', 'strategy_images/201510/201510091706346152.jpg', null, null, '10000', '韩国', '购物', '15852525252', '价廉物美', '<p>价廉物美<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('85', '89', '南浦洞购物街', '韩国南浦洞购物街别样体验，让你感受韩国特色的购物圣地，这里不仅是享受电影等文化生活的好地方', '1', 'strategy_images/201510/201510091711028652.jpg', null, null, '10000', '韩国', '购物', '15852525252', '价廉物美', '<p>价廉物美</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('87', '91', '机场', '    大连国际机场即大连周水子国际机场始建于1972年10月，现已成为国家一级民用国际机场，是国内主要干线机场和国际定期航班机\r\n', '1', 'strategy_images/201510/201510111642404028.jpg', null, null, '100000', '大连', '交通', '16565656565', '方便', '<p>方便</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('89', '93', '烟台莱山机场', '    烟台莱山国际机场于1984年10月开航，属军民合用机场。飞行区等级为4E级，跑道长3200米，可满足波音747等大型飞机\r\n', '1', 'strategy_images/201510/201510091720563630.jpg', null, null, '10000', '烟台市莱山区空港路', '交通', '535625377', '方便', '<p>方便</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('91', '97', '浦东国际机场', '上海浦东国际机场位于上海市东边，靠近滨海地带，距市中心约30公里，是中国（包括港、澳、台）三大国际机场之一，主要以国际航', '1', 'strategy_images/201510/201510091726302261.jpg', null, null, '10000', '浦东新区启航路900号', '交通', '02196990', '方便', '<p>方便<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('93', '99', '     福冈国际机场', '     福冈国际机场', '1', 'strategy_images/201510/201510111647018482.jpg', null, null, '100000', '日本福冈', '交通', '05356253777', '方便', '<p>&nbsp;&nbsp;&nbsp;&nbsp; 福冈国际机场</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('95', '101', '长崎机场', '长崎机场建于1975年，是由浮于长崎县中央部大村湾的萁岛填海而建，是世界上第一个海上机场', '1', 'strategy_images/201510/201510091733168966.jpg', null, null, '100000', '日本', '交通', '16565656565', '方便', '<p>方便<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('97', '103', '东京羽田国际机', '东京羽田国际机场建于 1931年8月，最早是一所国营的民航机场', '1', 'strategy_images/201510/201510091735469485.jpg', null, null, '100000', '日本', '交通', '16565656565', '方便', '<p>东京羽田国际机场建于 1931年8月，最早是一所国营的民航机场</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('99', '105', '     名古屋中部国际机场 ', '名古屋中部国际机场是日本第三座填海造陆的机场，前两座为长崎机场及关西国际机场', '1', 'strategy_images/201510/201510091737419172.jpg', null, null, '100000', '日本', '交通', '05356253777', '方便', '<p>名古屋中部国际机场是日本第三座填海造陆的机场，前两座为<a target=\"_blank\" href=\"http://baike.baidu.com/view/6584110.htm\">长崎机场</a>及<a target=\"_blank\" href=\"http://baike.baidu.com/view/365636.htm\">关西国际机场</a></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('101', '107', '     槟城国际机场 ', '槟城国际机场（IATA:PEN，IACO:WMKP），是一座位于马来西亚槟城的民用机场，位于槟城州首府乔治市以南16公里，是马来西亚航空的重点城市', '1', 'strategy_images/201510/201510111652412647.jpg', null, null, '100000', '马来西亚', '交通', '15852525252', '方便', '<p>槟城国际机场（IATA:PEN，IACO:WMKP），是一座位于马来西亚槟城的民用机场，位于<a target=\"_blank\" href=\"http://baike.baidu.com/view/428221.htm\">槟城州</a>首府乔治市以南16公里，是马来西亚航空的重点城市</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('103', '109', '巴生港 ', '巴生港为东南亚马来西亚联邦的最大港口，位于马六甲海峡的东北部。', '1', 'strategy_images/201510/201510091749092946.jpg', null, null, '10000', '马来西亚', '交通', '15852525252', '方便', '<p>巴生港为东南亚马来西亚联邦的最大港口，位于<a target=\"_blank\" href=\"http://baike.baidu.com/view/15939.htm\">马六甲海峡</a>的东北部。</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('105', '111', '济州国际机场 ', '济州国际机场 位于韩国济州岛济州市，建于1968年。2006年接待旅客达12,109,788 人次，是韩国第三大机场', '1', 'strategy_images/201510/201510111658341246.jpg', null, null, '10000', '韩国', '交通', '02196990', '方便', '<p>方便</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('107', '113', '仁川国际机场', '仁川国际机场韩国最大的民用机场，亚洲第6位最繁忙的国际机场', '1', 'strategy_images/201510/201510100847494026.jpg', null, null, '10000', '韩国', '交通', '16565656565', '方便', '<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/194472.htm\">仁川国际机场</a>韩国最大的民用机场，亚洲第6位最繁忙的国际机场</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('109', '115', '釜山金海国际机场', '釜山金海国际机场（三字代码（IATA）： PUS；四字代码（ICAO）：RKPK）位于釜山广域市江西区大渚2洞2350号，是韩国第二大国际机场，是大韩航空及韩亚航空的重点城市。', '1', 'strategy_images/201510/201510100852301258.jpg', null, null, '100000', '韩国', '交通', '02196990', '方便', '<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/25039.htm\">釜山</a>金海国际机场（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/1301538/1301538.htm\">三字代码</a>（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/362843/362843.htm\">IATA</a>）： PUS；四字代码（ICAO）：RKPK）位于釜山<a target=\"_blank\" href=\"http://baike.baidu.com/view/580537.htm\">广域市</a><a target=\"_blank\" href=\"http://baike.baidu.com/view/3379862.htm\">江西区</a>大渚2洞2350号，是韩国第二大国际机场，是大韩航空及韩亚航空的重点城市。</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('111', '117', '大连海景酒店', '酒店历史比较久，所以设施略显陈旧，但总体环境非常不错，房间大、干净而且能看到旁边的大海，服务也可以', '1', 'strategy_images/201510/201510111706216440.jpg', null, null, '41100', ' 大连 中山区 港湾街2号 ，近人民路口', '住宿', '15852525252', '环境优美', '<p><a target=\"_blank\" href=\"http://you.ctrip.com/hotels/Dalian4/21231635.html#ctm_ref=gs_ttd_261012_33_hod_2_4_undefined_rN_sN_tN_fN_D_0\">大连海景酒店</a></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('113', '119', '烟台马山寨高尔夫酒店', '烟台马山寨高尔夫酒店座落于马山寨最高处的古锋火台旁，与自然环境融为一体，海天一色，景观迷人。酒店共有十层，三面临海', '1', 'strategy_images/201510/201510100912051341.jpg', null, null, '24000', '莱山区马山寨高尔夫俱乐部', '住宿', '16565656565', '环境优美', '<p>烟台马山寨高尔夫酒店座落于马山寨最高处的古锋火台旁，与自然环境融为一体，海天一色，景观迷人。酒店共有十层，三面临海</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('115', '121', '上海宝安大酒店', '宝安大酒店座落于上海浦东新区陆家嘴金融贸易区的世纪大道－东方路交汇处。 ', '1', 'strategy_images/201510/201510100919338936.jpg', null, null, '100000', ' 浦东新区东方路800号', '住宿', '02151159888', '环境优美', '<p>环境优美</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('117', '123', '福冈日航酒店', '酒店与博多运河城、中洲相邻，和JR、地铁博多站直接连接。位于从福冈机场乘坐地铁约5分钟的绝佳地段。', '1', 'strategy_images/201510/201510111712488388.jpg', null, null, '24000', '日本', '住宿', '15852525252', '环境优美', '<p><span class=\"desc\">酒店与博多运河城、中洲相邻，和JR、地铁博多站直接连接。位于从福冈机场乘坐地铁约5分钟的绝佳地段。</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('119', '125', '长崎清风酒店', '建于能一览长崎市内景色的稻佐山的山腰。从所有客房都能观赏到港口、夜景、日出。您可以一边欣赏号称价值一千万美元的美丽夜景一边享受晚餐。', '1', 'strategy_images/201510/201510100928254852.jpg', null, null, '10000', '日本', '住宿', '05356253777', '环境优美', '<p><span class=\"desc\">建于能一览长崎市内景色的稻佐山的山腰。从所有客房都能观赏到港口、夜景、日出。您可以一边欣赏号称价值一千万美元的美丽夜景一边享受晚餐。</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('121', '127', '东京汐留芬迪别墅酒店', '东京汐留芬迪别墅酒店距离JR新桥火地铁车站（JR Shinbashi Train Station）只需要5分钟步行路程', '1', 'strategy_images/201510/201510100931522677.jpg', null, null, '100000', '日本', '住宿', '16565656565', '环境优美', '<p>东京汐留芬迪别墅酒店距离JR新桥火地铁车站（JR Shinbashi Train Station）只需要5分钟步行路程<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('123', '129', '名古屋荣多米豪华酒店', '名古屋荣多米豪华酒店位于名古屋市中心的荣地区，可方便前往市内各处景点。距离中部国际机场仅50分钟车程', '1', 'strategy_images/201510/201510100934182481.jpg', null, null, '100000', '日本', '住宿', '05356253777', '环境优美', '<p>名古屋荣多米豪华酒店位于名古屋市中心的荣地区，可方便前往市内各处景点。距离中部国际机场仅50分钟车程</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('125', '131', '槟城香格里拉金沙滩度假村', '槟城香格里拉金沙滩度假村是一家豪华五星级酒店，隶属香格里拉酒店集团，建于1975年', '1', 'strategy_images/201510/201510111725031925.jpg', null, null, '100000', '马来西亚', '住宿', '02196990', '环境优美', '<p><span title=\"槟城香格里拉金沙滩度假村是一家豪华五星级酒店，隶属香格里拉酒店集团，建于1975年，酒店设施设备齐全，酒店同时配备游泳池以及划板、冲浪、滑翔伞等水上活动，是旅游度假休闲的好去处。\" class=\"desc\">槟城香格里拉金沙滩度假村是一家豪华五星级酒店，隶属香格里拉酒店集团，建于1975年</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('127', '133', '马拉瓦迪别墅', '马拉瓦迪别墅是商务人士和观光游客前往巴生的理想下榻之处。 完善的设施，精美的装饰，这些都可让您在住宿期间感受到更多愉悦。', '1', 'strategy_images/201510/201510100942201428.jpg', null, null, '100000', '马来西亚', '住宿', '05356253777', '环境优美', '<p><span class=\"desc\">马拉瓦迪别墅是商务人士和观光游客前往巴生的理想下榻之处。 完善的设施，精美的装饰，这些都可让您在住宿期间感受到更多愉悦。</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('129', '135', '济州岛乐天酒店', '酒店位于美丽的中文旅游度假区，濒临海岸，建筑极具热带风格。饱览山海湖园的美丽景致，体验济州岛的美味情缘', '1', 'strategy_images/201510/201510111731569267.jpg', null, null, '24000', '韩国', '住宿', '15852525252', '环境优美', '<p><span class=\"desc\">酒店位于美丽的中文旅游度假区，濒临海岸，建筑极具热带风格。饱览山海湖园的美丽景致，体验济州岛的美味情缘</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('131', '137', '仁川最佳西方机场酒店)', '仁川最佳西方机场酒店位于国际商务中心内，乘坐酒店的免费班车约3分钟即可抵达仁川机场', '1', 'strategy_images/201510/201510100948436468.jpg', null, null, '41100', '韩国', '住宿', '02196990', '环境优美', '<p><span title=\"仁川最佳西方机场酒店位于国际商务中心内，乘坐酒店的免费班车约3分钟即可抵达仁川机场。酒店除了供客人免费使用健身房和商务中心外，还提供带免费网络连接的客房。\" class=\"desc\">仁川最佳西方机场酒店位于国际商务中心内，乘坐酒店的免费班车约3分钟即可抵达仁川机场</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('133', '139', '釜山天堂酒店', '釜山天堂酒店位于海云台地区沙滩附近，交通便捷，地理位置优越，海云台沙滩尽在咫尺，旅客可以在沙滩上休息及轻松自在的享受海边美丽景色。', '1', 'strategy_images/201510/201510100951361188.jpg', null, null, '24000', '韩国', '住宿', '15852525252', '环境优美', '<p><span class=\"desc\">釜山天堂酒店位于海云台地区沙滩附近，交通便捷，地理位置优越，海云台沙滩尽在咫尺，旅客可以在沙滩上休息及轻松自在的享受海边美丽景色。</span></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('135', '141', '炒海肠子', '炒海肠子', '1', 'strategy_images/201510/201510121652386429.jpg', null, null, '10000', '大连', '美食', '15852525252', '基本也只有在小食摊上才有，而在大连，有了这家糯米香，就完全不同了，不但是正规的店，而且品种极其丰富，基本就是一站式服务，一次吃到爽。', '<p>基本也只有在小食摊上才有，而在大连，有了这家糯米香，就完全不同了，不但是正规的店，而且品种极其丰富，基本就是一站式服务，一次吃到爽。，全是幸福的感觉，不过千万记住，这炸元宵一定要新炸的，如果是放了一会儿的千万不要点，这个东西一凉了实在没法吃</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('137', '143', '海鲜焖子', '海鲜焖子', '1', 'strategy_images/201511/201511091126481305.jpg', null, null, '10000', '大连', '美食', '18565656565', '鸡腿螺：外型和其他螺无太多区别，只是表面纹路更粗糙些', '<p>鸡腿螺：外型和其他螺无太多区别，只是表面纹路更粗糙些，最大的不同在与螺肉本身，形状像一个小小的鸡腿。白白嫩嫩，好比丰满女人的如雪肌肤。入口则更是清甜，螺肉很紧实，慢慢咀嚼，很韧，很有咬劲，能让人在嘴里充分地嚼出螺的鲜和香来，别具一格。<br/>扇贝：只有一个闭壳肌，所以是属于单柱类的。闭壳肌肉色洁白、细嫩、味道鲜美，营养丰富。</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('139', '145', '刺身', '刺身，通俗点讲就是生鱼片，是日本的国菜，鲜嫩的鱼片配上芥末和鲜香的日式酱油，即使不爱吃生食的你，尝过也会称赞。', '1', 'strategy_images/201510/201510111510063424.jpg', null, null, '1000', '日本', '美食', '13525252525', '刺身，通俗点讲就是生鱼片，是日本的国菜，鲜嫩的鱼片配上芥末和鲜香的日式酱油，即使不爱吃生食的你，尝过也会称赞。', '<p>刺身，通俗点讲就是生鱼片，是日本的国菜，鲜嫩的鱼片配上芥末和鲜香的日式酱油，即使不爱吃生食的你，尝过也会称赞。<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('141', '147', '豚骨拉面', '汤是用柴鱼和银鱼熬的汤，味道浓郁，颜色呈现奶白色，带着猪软骨的大块排骨也是炖了很久后，洗去多余的油脂才可以被放到这碗面上的，肉入口即化', '1', 'strategy_images/201510/201510111512047457.jpg', null, null, '1000', '日本', '美食', '15252525253', '汤是用柴鱼和银鱼熬的汤，味道浓郁，颜色呈现奶白色，带着猪软骨的大块排骨也是炖了很久后，洗去多余的油脂才可以被放到这碗面上的，肉入口即化', '<p>汤是用柴鱼和银鱼熬的汤，味道浓郁，颜色呈现奶白色，带着猪软骨的大块排骨也是炖了很久后，洗去多余的油脂才可以被放到这碗面上的，肉入口即化<br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('143', '149', '椰浆饭', '椰浆饭椰浆饭这个饭的名称来自它的烹饪过程，那就是把饭浸泡在浓椰浆里后再把饭与椰浆的混合物拿去蒸', '1', 'strategy_images/201510/201510111519549957.jpg', null, null, '1000', '马来西亚', '美食', '15252525251', '这个饭的名称来自它的烹饪过程，那就是把饭浸泡在浓椰浆里后再把饭与椰浆的混合物拿去蒸', '<p>这个饭的名称来自它的烹饪过程，那就是把饭浸泡在浓椰浆里后再把饭与椰浆的混合物拿去蒸</p><p><br/></p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('145', '151', '炒粿条', '以酱油、黑酱油、蚝油为主要酱料，嗜辣者还可以配上森巴辣椒酱，使炒粿条的味道在咸甜中带点辣味', '1', 'strategy_images/201510/201510101727329112.jpg', null, null, '1000', '马来西亚', '美食', '15252525251', '以酱油、黑酱油、蚝油为主要酱料，嗜辣者还可以配上森巴辣椒酱，使炒粿条的味道在咸甜中带点辣味', '<p>以酱油、黑酱油、蚝油为主要酱料，嗜辣者还可以配上森巴辣椒酱，使炒粿条的味道在咸甜中带点辣味</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('147', '153', '黑猪肉', '黑猪肉无疑是济州岛一大特产，只有在济州岛，才能吃到正宗的韩式烤黑猪肉', '1', 'strategy_images/201510/201510121655163638.jpg', null, null, '1000', '韩国', '美食', '15252525253', '黑猪肉无疑是济州岛一大特产，只有在济州岛，才能吃到正宗的韩式烤黑猪肉', '<p>黑猪肉无疑是济州岛一大特产，只有在济州岛，才能吃到正宗的韩式烤黑猪肉</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('149', '155', '生鱼片', '鱼片是济州岛最著名的特产之一。四周海洋环抱的济州岛，鲜嫩的生鱼片是海产中的极品', '1', 'strategy_images/201510/201510111540331575.jpg', null, null, '1000', '韩国', '美食', '15252525251', '鱼片是济州岛最著名的特产之一。四周海洋环抱的济州岛，鲜嫩的生鱼片是海产中的极品', '<p>鱼片是济州岛最著名的特产之一。四周海洋环抱的济州岛，鲜嫩的生鱼片是海产中的极品</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('151', '157', '冰峪沟', '方小桂林——冰峪沟：适逢雨过天晴的秋天，天蓝、山青、水秀、空气清新，心情那叫一个爽啊', '1', 'strategy_images/201510/201510111544271081.jpg', null, null, '1000', '中国', '美景', '1525252525', '美景', '<p>方小桂林——冰峪沟：适逢雨过天晴的秋天，天蓝、山青、水秀、空气清新，心情那叫一个爽啊</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('153', '159', '广鹿岛', '是国家级海岛森林公园，是辽宁省的风景名胜区之一', '1', 'strategy_images/201510/201510111546253820.jpg', null, null, '1000', '中国', '美景', '1525252525', '美景', '<p>是国家级海岛森林公园，是辽宁省的风景名胜区之一</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('155', '161', '福冈塔', '地铁坐到唐人町，还要走2公里的路，好远，其实可以在天神博多坐公交车直接到福冈塔', '1', 'strategy_images/201510/201510111600259159.jpg', null, null, '1000', '日本', '美景', '1525252525', '美景', '<p>地铁坐到唐人町，还要走2公里的路，好远，其实可以在天神博多坐公交车直接到福冈塔</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('157', '163', '栉田神社', '抽了上上签，方便，有三个箱子分别注明日文，中文，英文，把50日元放进去，就可以取了。值得看看', '1', 'strategy_images/201510/201510111602131225.jpg', null, null, '1000', '日本', '美景', '1525252525', '美景', '<p>抽了上上签，方便，有三个箱子分别注明日文，中文，英文，把50日元放进去，就可以取了。值得看看</p>', 'zh_cn');
