INSERT INTO `vcos_strategy_language` VALUES ('265', '271', '糯米香', '我最喜欢的食品一是甜，这主要是味道，二是黏，这主要是口感，而这糯米香所卖的东西基本都是既甜又黏，实在是我的大爱。在哈尔滨的时候，又甜又黏', '1', 'strategy_images/201511/201511091048586527.jpg', null, null, '1000', '大连', '美食', '1363636', '我最喜欢的食品一是甜，这主要是味道，二是黏，这主要是口感，而这糯米香所卖的东西基本都是既甜又黏，实在是我的大爱。在哈尔滨的时候，又甜又黏', '<p>我最喜欢的食品一是甜，这主要是味道，二是黏，这主要是口感，而这糯米香所卖的东西基本都是既甜又黏，实在是我的大爱。在哈尔滨的时候，又甜又黏的主要是\r\n黏豆包，但这基本是要等过年的时候才有的买，平时是买不到的，至于麻团、油炸糕一类的，基本也只有在小食摊上才有，而在大连，有了这家糯米香，就完全不同\r\n了，不但是正规的店，而且品种极其丰富，基本就是一站式服务，一次吃到爽。<br/>店里的环境虽然很普通，甚至有点简陋，但是看到柜子里满满的好吃的，也就让人把这些忽略掉了。这里必吃的有红豆粥，因为黏的东西虽然好吃，但一是不好消\r\n化，二是比较腻，所以来碗粥来中和一下是再好不过的了。炸元宵非常香，口感又好，一口下去酥酥的、甜甜的、香香的，全是幸福的感觉，不过千万记住，这炸元\r\n宵一定要新炸的，如果是放了一会儿的千万不要点，这个东西一凉了实在没法吃。再有，就是推荐麻团和油炸糕，这两样也一定要趁热吃，凉的和热的完全是两个等\r\n级的口感差距。至于价位，两个人去，基本人均10元出头就可以吃的不错了，很实惠。</p>', 'zh_cn');
INSERT INTO `vcos_strategy_language` VALUES ('267', '273', '旅大印象餐厅', '最早开业的时候我应该是还在上学或者是刚刚毕业，那个时候旅大印象排队排的简直就不要不要的，再回去吃的时候就没有那么多人在排队了', '1', 'strategy_images/201511/201511091101505993.jpg', null, null, '2000', '大连', '美食', '1363636', '最早开业的时候我应该是还在上学或者是刚刚毕业，那个时候旅大印象排队排的简直就不要不要的，再回去吃的时候就没有那么多人在排队了', '<p>很火爆的店，本来想着晚点去应该不用等位，结果一点多到的，还要等14位，这是有多火爆啊。<br/>我们点的菜，两个人，真心浪费很多。去之前团购了优惠券，70元一张面值的，团了两张，点的菜整整好好200元，西瓜是赠送的。点的都是销量冠军的，但是\r\n建议依个人口味点吧，香肴肉基本就没怎么吃，辣炒蚬子倒是都吃了，很好吃，肉很多，各个都有肉，喜欢这个口味的。老粗黄瓜扇贝也不错，黄瓜很爽口，酸酸甜\r\n甜的，海胆豆腐没吃多少，最后上的吃不下了。海鲜有按份的有按斤的，对我这不经常吃海鲜的人来说很口水啊，很好吃。</p>', 'zh_cn');
