  `totale_price` int(11) NOT NULL DEFAULT '0',
  `pay_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '支付类型(1余额，2挂账，3到付)',
  `order_check_num` varchar(32) DEFAULT NULL COMMENT '订单校验码',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `order_create_time` datetime NOT NULL COMMENT '订单创建时间',
  `order_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0订单提交,1订单支付,2订单发货,3订单完成，4订单取消，5，处理中,6.交易失败，暂无库存,7.删除订单',
  `order_remark` varchar(100) DEFAULT NULL,
  `is_read` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `order_type` tinyint(4) DEFAULT NULL COMMENT '1餐厅,2免税店,3网络服务，4电话服务',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `store_name` varchar(100) DEFAULT NULL COMMENT '店铺名',
  `receiving_way` tinyint(4) DEFAULT '1' COMMENT '接收方式1自提，2送货到房间',
  `consignee_address` varchar(255) DEFAULT NULL COMMENT '收货人地址',
  `delivery_time` varchar(50) DEFAULT NULL COMMENT '送达时间',
  `is_comment` tinyint(4) DEFAULT '0' COMMENT '是否评论',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `additional_cost` int(11) DEFAULT NULL,
  `additional_cost_info` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1465 DEFAULT CHARSET=utf8;

